import React from 'react';
import axios from 'axios';
const queryString = require('query-string');

class Search extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      listData: [],
      image: null,
    };
  }

  componentDidMount = async () => {
    const parsed = queryString.parse(this.props.location.search);
    console.log(parsed);
    const keyword = parsed.query || '';
    if (!keyword) {
      // this.props.history.push('/');
    }

    const token = localStorage.getItem('token') || '';
    console.log('check', token);

    if (!token) {
      this.props.history.push('/login');
    }

    const apiKey = `AIzaSyCNVdmVs_BkQDfpcwH_pw7qjjRIrMl_uMQ`;
    let res = await axios.get(
      'https://maps.googleapis.com/maps/api/geocode/json?address=1600+Amphitheatre+Parkway,+Mountain+View,+CA&key=${apiKey}'
    );

    console.log('res', res);
    this.setState({
      listData: res.data,
    });
  };

  render() {
    const { listData } = this.state;
    return (
      <div className='container'>
        {/* {listData.map((value) => {
          return (
            <div className='content' key={value.id}>
              {}
            </div>
          );
        })} */}
      </div>
    );
  }
}

export default Search;
